import React from "react";
import "./Card.scss";

const Card = props => {
  return (
    <div className="contenedor-Texto">
      <p>{props.texto}</p>
      <table>
        <thead>
          <tbody>
            <tr>
              <td>
                {props.texto2}

                  <select>
                    <option>2X2</option>
                  </select>
                  <input
                    type="checkbox"
                    className="input1"
                    onChange={e => props.texto2(e.target.value)}
                  />
              </td>
            </tr>
          </tbody>
        </thead>
      </table>
    </div>
  );
};

export default Card;
